import React, { Component } from 'react'
import ReactModal from 'react-modal'

ReactModal.setAppElement('#root');

class ProfileModal extends Component {
  render(){
    return(
      <ReactModal isOpen={this.props.showModal}>
      </ReactModal>
    )
  }
}

export default ProfileModal;
